import React from "react";

const deleteItem = (ev) => {
  console.log(ev.target);
};
const List = (props) => {
  return (
    <>
      {props.persons.map((pers) => (
        <li>
          <p key={pers.name}>
            <span>{pers.name}</span>
            {": "}
            {pers.number}
          </p>
          <button onClick={deleteItem}>Delete</button>
        </li>
      ))}
    </>
  );
};
export default List;
